import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { User } from '../models/User';
import { Professor } from '../models/Professor';
import { CV } from '../models/CV';

@Injectable({
  providedIn: 'root'
})
export class RegisterProfessorServiceService {

  constructor(private httpClient:HttpClient) { }

  createUser(u:User){
    u.type=2;
    if(u.image==null){
      u.image = "";
    }
    return this.httpClient.post<number>("http://localhost:8080/userRegistration/user", u);
  }
  createProfessor(p:Professor){
    p.type=2;
    if(p.image==null || p.image==""){
      p.image = "";
    }
    return this.httpClient.post<number>("http://localhost:8080/userRegistration/professor", p);
  }

  addCV(cv:CV){
    return this.httpClient.post("http://localhost:8080/userRegistration/cv", cv);
  }
  getCV(id:number){
    return this.httpClient.get<CV>("http://localhost:8080/userRegistration/getCV?id=" + id);
  }
}
